import './App.css';

function App() {
  return (
    <div className="App">
      <header className="header_section">
        <img src="asset/icon/insta.png" alt="insta_logo" class="insta"/>
        <input placeholder="Search" type="text" class="search"/>
        <img src="asset/icon/head.png" alt="head_icon" class="head_icon"/>
        <img src="asset/avt1.jpg" alt="avatar" class="avt"/>
      </header>
    </div>
  );
}

export default App;
